import './App.scss';
import {
    BrowserRouter,
    HashRouter as Router,
    Switch,
    Routes,
    Route,
    Link
} from "react-router-dom";
import logo from "./images/logo.png";
import Video from "./components/video/Video";
import Features from "./components/features/Features";
import Contains from "./components/contains/Contains";
import Prices from "./components/prices/Prices";
import HowToWork from "./components/howToWork/HowToWork";
import Contact from "./components/contact/Contact";
import phone from './assets/phone.svg';
import map from './assets/map.svg';
import Layout from "./components/layout/Layout";

function App() {
  return (
    <div className="App">
        <BrowserRouter>
      <header className="App-header">
          <div className="container">
              <img src={logo} alt="logo"/>
              <div className="menu">
                  <Link to="/features">преимущества</Link>
                  <Link to="/contains">комплектация</Link>
                  <a>цены & примеры работ</a>
              </div>
              <div className="contacts">
                  <div>
                      <img src={phone}/>
                      <a href="tel:+74732287672">+7 (473) 228-76-72</a>
                      <img src={phone}/>
                      <a href="tel:+79081428392">+7 (908) 142-83-92</a>
                  </div>
                  <div>
                      <img src={map}/>
                      <p>г.Воронеж, Московский пр-т, 11И, оф. 18</p>
                  </div>
                  <button>ОБРАТНЫЙ ЗВОНОК</button>
              </div>
          </div>
      </header>
        <Layout/>
        <Video/>
        <Contains/>

        <Routes>
            <Route path="./components/features/Features" element={<Features />} />
            <Route path="/contains" element={Contains} />
        </Routes>




        <Prices/>
        <HowToWork/>
        <Contact/>
        </BrowserRouter>
    </div>
  );
}

export default App;
